import React, { Component } from 'react';
import '../css/experience.css';
;

function ExperienceComp(props) {
    return <div className="flexwrap">
        <div className="wrapperEdu">
            <div className="title" contentEditable="true">{props.title}</div>
            <div className="desc" contentEditable="true">{props.desc}</div>
        </div>
        <div className="wrapperEdu">
            <div className="title time" contentEditable="true">{props.since}-{props.to}</div>
            <div className="desc where" contentEditable="true">{props.where}</div>
        </div>
    </div>
}


export default ExperienceComp
